IF EXISTS(
SELECT
      ROUTINE_SCHEMA
    , ROUTINE_NAME
FROM
    INFORMATION_SCHEMA.ROUTINES
WHERE
    ROUTINE_DEFINITION LIKE '%F_TIPO_EXTRATO%' 
 
) BEGIN

	DROP FUNCTION F_TIPO_EXTRATO; 

END 
GO
CREATE FUNCTION F_TIPO_EXTRATO (@p_tipo INT)
RETURNS VARCHAR(50)
AS
BEGIN
  DECLARE @tipo VARCHAR(50) = '-'

  IF (@p_tipo = 0
    OR @p_tipo = 1)
  BEGIN
    SET @tipo = 'Deb'
  END
  IF (@p_tipo = 2
    OR @p_tipo = 3)
  BEGIN
    SET @tipo = 'Cre'
  END
  IF (@p_tipo = 4)
  BEGIN
    SET @tipo = 'Transf'
  END
  IF (@p_tipo = 5
    OR @p_tipo = 6)
  BEGIN
    SET @tipo = 'Cheque'
  END

  RETURN
  @tipo
END
GO


